import Link from 'next/link';

const LandingPage = () => {

  return (
    <div className="landing">
      <img src='../assets/media/yellow-close.png' alt="" className="splash-photo_left"/>
      <p>photo1</p>
      <img src='../assets/media/yellow-wide.png' alt="" className="splash-photo_right"/>
      <p>photo2</p>
    </div>
  );
};

export default LandingPage;
